(1, '1115', '2025-04-24', 'OE60361187', '2025-04-24 06:51:25', 'en_transito', 'Janaya Trill', '(304) 029-6221', 'Cum didicerimus quid natura postulet non intellegunt, errore maximo, si Epicurum. Ex improbis factis ad minuendas vitae molestias accessio potest fieri, quanta ad augendas, cum conscientia. Itaque primos congressus copulationesque et.', '2024-09-26 15:53:43', '2024-10-02 05:38:25'),
(2, '2482', '2024-12-10', 'GV39323659', '2024-12-10 00:53:41', 'pendiente', 'Darrell Hembry', '(814) 145-1551', 'Sunt cupiditates inmensae et inanes divitiarum, gloriae, dominationis, libidinosarum. Utrum igitur percurri omnem Epicuri disciplinam placet an de una voluptate quaeri, de.', '2024-09-26 15:59:43', '2024-09-28 12:48:35'),
(3, '2644', '2025-05-17', 'DZ01944052', '2025-05-17 23:44:30', 'asignado', 'Gabie Bushel', '(520) 830-2516', 'Et laetamur amicorum laetitia aeque atque nostra et pariter dolemus angoribus. Hanc ego cum teneam sententiam, quid est cur dubitemus dicere et sapientiam propter. Stultorum vitam cum sua comparat, magna afficitur voluptate.', '2024-09-26 16:02:23', '2024-10-02 21:22:14'),
(4, '1074', '2024-10-13', 'BM51971389', '2024-10-13 18:49:08', 'retornado', 'Augusta Grishukov', '(301) 269-3525', 'Utramque Menandri legam? A quibus tantum dissentio, ut, cum Sophocles vel optime.', '2024-09-26 16:08:58', '2024-09-26 23:19:05'),
(5, '678', '2025-02-21', 'WC46745770', '2025-02-21 04:08:18', 'entregado', 'Milo Gull', '(302) 959-5706', 'Ferrentur et, ut dixi, ad lineam, hunc naturalem esse. Ultimum, quo sint omnia bene vivendi recteque. Ratione intellegi posse et voluptatem ipsam per se esse fugiendum. Itaque aiunt hanc quasi.', '2024-09-26 16:10:14', '2024-09-30 13:04:26'),
(6, '267', '2025-06-08', 'RL55647858', '2025-06-08 19:42:23', 'entregado', 'Chiquia Sumption', '(917) 179-0085', 'Sermo atque fama, tum accusator, tum iudex. Fabulae declarant, in quibus nulla solida utilitas omnisque puerilis est delectatio, aut se, ut. Ex cupiditatibus odia, discidia, discordiae, seditiones, bella. Iam de omnium virtutum cursu ad voluptatem proprius disserendi locus. Nunc autem.', '2024-09-26 16:14:43', '2024-10-03 11:55:53'),
(7, '1374', '2024-11-28', 'CB25369032', '2024-11-28 12:08:42', 'en_transito', 'Honoria O''Currine', '(415) 046-4216', 'Nec vero hoc oratione solum. Nihil ad iucunde vivendum reperiri posse.', '2024-09-26 16:21:51', '2024-09-28 05:35:47'),
(8, '2467', '2024-11-24', 'LR19828041', '2024-11-24 23:26:55', 'pendiente', 'Correy Gutteridge', '(915) 489-0561', 'Eruditi Graecis litteris, contemnentes Latinas, qui. Minorem. Ita, quae mutat, ea corrumpit, quae sequitur sunt tota Democriti, atomi, inane, imagines.', '2024-09-26 16:24:14', '2024-09-28 03:18:57'),
(9, '1264', '2025-08-21', 'EM98988026', '2025-08-21 22:09:26', 'asignado', 'Moreen Fedynski', '(915) 710-9990', '-- aut ne deterruisset alios a studiis. Hoc loco dictum sit. Erit enim iam. De dividendo ac partiendo docet, non quo ignorare vos arbitrer, sed ut ratione et via. Eloquentiam, non asperner, si non habeat, non. Populo Romano locatus sum, debeo profecto, quantumcumque possum, in eo essent. Quae cum tota.', '2024-09-26 16:26:32', '2024-10-05 12:51:11'),
(10, '2061', '2025-06-23', 'HI85694982', '2025-06-23 07:38:22', 'retornado', 'Karleen Spadaro', '(217) 943-8907', 'In conspectum suum venire vetuit. Tota Democriti, atomi, inane, imagines, quae eidola nominant, quorum incursione. Quidem videtur, inermis ac nudus est. Tollit definitiones, nihil de dividendo ac partiendo. Quibusdam neque pecuniae modus est neque honoris neque imperii.', '2024-09-26 16:35:29', '2024-10-03 21:48:36'),
(11, '2868', '2025-01-02', 'ZS94967885', '2025-01-02 18:09:05', 'asignado', 'Gradeigh Mathen', '(304) 695-4934', 'Privatio recte nominata est voluptas. Ut enim, cum cibo et potione fames sitisque. Bonum.'' Hoc ne statuam quidem dicturam pater.', '2024-09-26 16:42:58', '2024-09-29 05:07:36'),
(12, '142', '2025-08-02', 'UV22143427', '2025-08-02 04:09:47', 'retornado', 'Leia Trotman', '(979) 741-5739', 'Interdictum puto. Locos quidem quosdam, si videbitur, transferam, et maxime ab iis. Pugnare, qui Graeca legere malint, modo legant illa ipsa. Andriam Terentii quam utramque Menandri. Tantum enim esse censet, quantus videtur, vel paulo aut maiorem aut minorem. Ita, quae.', '2024-09-26 16:46:13', '2024-10-05 00:11:42'),
(13, '450', '2025-02-14', 'QI94832909', '2025-02-14 00:56:18', 'pendiente', 'Portia Critchell', '(919) 436-6567', 'Gloriae, dominationis, libidinosarum etiam voluptatum. Accedunt aegritudines, molestiae, maerores, qui. Ac fieri potest, ut propemodum iustioribus utamur illis, qui omnino avocent a philosophia.', '2024-09-26 16:54:41', '2024-09-30 09:07:28'),
(14, '2411', '2025-09-21', 'BR66787032', '2025-09-21 11:27:52', 'en_transito', 'Howey Christmas', '(864) 463-6258', 'Quod quaeritur, sit pulcherrimum. Etenim si delectamur, cum scribimus, quis est tam invidus, qui. Causa est, quod huc possit, quod conetur, nec optinere, si effecerit. Aut maiorem aut minorem. Ita, quae mutat, ea corrumpit, quae sequitur. .'' nihilo minus legimus quam hoc idem. Suum scribere? Quodsi Graeci leguntur.', '2024-09-26 16:58:59', '2024-10-06 09:29:04'),
(15, '1609', '2025-02-08', 'FC21524954', '2025-02-08 13:41:14', 'entregado', 'Darya Shepherdson', '(360) 876-5096', 'Omnes, fatendum est summum esse bonum quicquam nisi. Bello animadversionis metu contineret, saluti prospexit civium, qua intellegebat contineri suam. Atque.', '2024-09-26 17:08:42', '2024-09-30 05:45:43'),
(16, '376', '2025-01-09', 'RF88769923', '2025-01-09 07:11:06', 'retornado', 'Yves Graveson', '(727) 563-2949', 'Quieti videre, nihil tranquilli potest. Quodsi corporis gravioribus. Tamen permagna accessio potest, si aliquod aeternum et infinitum impendere.', '2024-09-26 17:12:52', '2024-09-29 09:55:38'),
(17, '1982', '2025-02-09', 'VJ85888543', '2025-02-09 06:38:40', 'entregado', 'Gregg Izkovicz', '(202) 079-9757', 'Dicit plane, quod intellegam; et tamen ego. Ob eam causam non multo maiores esse et voluptates et dolores nasci fatemur e.', '2024-09-26 17:16:17', '2024-09-30 06:21:11'),
(18, '1677', '2025-05-14', 'BM42542028', '2025-05-14 06:07:26', 'en_transito', 'Lenora Fellgett', '(304) 683-4566', 'Maxime ab iis, quos ego posse iudicare arbitrarer, plura. Concursio hunc mundi ornatum efficere non. Autem alia malunt scribi a nobis, aequi esse debent, quod et posse.', '2024-09-26 17:20:28', '2024-10-02 20:13:00'),
(19, '962', '2025-04-29', 'JO18364311', '2025-04-29 04:46:10', 'pendiente', 'Claus Gagg', '(786) 214-8637', 'Patrioque amori praetulerit ius maiestatis atque imperii. Quid? T. Et iis, quos modo nominavi, cum inciderit, ut id meo. Non beatus. Multoque hoc melius nos.', '2024-09-26 17:26:58', '2024-10-02 10:25:30'),
(20, '1651', '2025-09-18', 'UL28919510', '2025-09-18 07:48:13', 'asignado', 'Dianne Abramow', '(850) 108-4962', 'Intellegi posse et voluptatem pleniorem efficit. Illis, qui omnino avocent a philosophia, quam. Rerum defuturum, quas natura non depravata desiderat. Tum vero, si stabilem scientiam rerum tenebimus, servata illa. Cum istis tantopere pugnare, qui Graeca legere malint, modo legant illa ipsa.', '2024-09-26 17:33:06', '2024-10-06 07:58:49'),
(21, '1598', '2024-11-20', 'PU58911563', '2024-11-20 18:22:04', 'entregado', 'Quinn Nilles', '(404) 857-9562', 'Parta minuit, sed potius inflammat, ut coercendi magis quam dedocendi esse. Summum malum et, quantum possit, a se ipse dissidens secumque.', '2024-09-26 17:42:44', '2024-09-28 01:51:17'),
(22, '319', '2025-10-02', 'WK33023617', '2025-10-02 10:49:52', 'retornado', 'Madelle Ducastel', '(859) 061-8198', 'Quiddam inter dolorem et voluptatem; illud enim ipsum, quod quibusdam medium videretur, cum omni. Afranius a Menandro solet. Nec vero, ut noster Lucilius, recusabo, quo minus id, quod. Distinctio. Nam libero tempore, cum soluta nobis est eligendi. Nec assiduitas nec vigiliae nec ea ipsa, quae laudatur, industria, ne fortitudo quidem. Et in conspectum suum venire vetuit, numquid tibi.', '2024-09-26 17:44:56', '2024-10-06 17:27:57'),
(23, '2239', '2024-10-05', 'LB85342757', '2024-10-05 23:57:32', 'pendiente', 'Cristionna Healy', '(941) 332-2917', 'Factis non emolumento aliquo, sed ipsius honestatis decore laudandis, id.', '2024-09-26 17:54:55', '2024-09-26 19:57:52'),
(24, '287', '2024-12-07', 'JJ18564520', '2024-12-07 06:51:00', 'en_transito', 'Evita Hawksley', '(609) 958-6023', 'Forte successerit, at contra gaudere nosmet omittendis doloribus, etiamsi voluptas ea, quae hoc non. Quae percipitur omni dolore et.', '2024-09-26 17:55:59', '2024-09-28 12:56:17'),
(25, '2878', '2025-09-05', 'PZ82271146', '2025-09-05 03:39:08', 'asignado', 'Corine Stitcher', '(785) 202-8169', 'Multa non probo, inquam. De cetero vellem equidem aut ipse doctrinis fuisset instructior. Maxime ab iis, quos modo nominavi, cum inciderit. Expetendis aut fugiendis ut rationem sequamur monet. Nec enim habet. Arte laudatur, sic sapientia, quae ars vivendi. Causam non fuisse. -- Torquem detraxit hosti. .', '2024-09-26 17:58:35', '2024-10-05 23:44:35'),
(26, '1183', '2025-04-01', 'EW77729116', '2025-04-01 01:39:20', 'retornado', 'Dodie Greenhalgh', '(314) 481-9478', 'Voluptas animi et corporis voluptatibus, videtisne. Epicurus terminari summam voluptatem, ut postea variari voluptas distinguique possit, augeri amplificarique non possit. At. Ad quietem et ad usus civium non.', '2024-09-26 18:07:53', '2024-10-01 16:36:38'),
(27, '96', '2025-03-05', 'EJ58299552', '2025-03-05 19:19:09', 'pendiente', 'Alexandros Hamsley', '(419) 829-7152', 'Natura postulet non intellegunt, errore maximo, si Epicurum audire. Docet, tum denique poterit aliquid cognosci et percipi. Quos. Etiam ac ratione intellegi posse et voluptatem pleniorem efficit. Itaque non ob.', '2024-09-26 18:13:19', '2024-09-30 23:25:54'),
(28, '2249', '2024-10-19', 'VL12241464', '2024-10-19 21:48:54', 'en_transito', 'Sandro Tripon', '(602) 831-7714', 'Tradere et negent satis esse, quid bonum sit aut quid malum, sensu iudicari, sed animo.', '2024-09-26 18:18:06', '2024-09-27 05:29:51'),
(29, '526', '2025-05-03', 'XQ86514826', '2025-05-03 22:22:12', 'asignado', 'Lyndel Lambotin', '(408) 410-1741', 'Ratio docet, tum denique poterit aliquid cognosci et percipi. Quos qui tollunt. Bona praeterita non meminerunt, praesentibus non. Qui blanditiis praesentium voluptatum deleniti atque corrupti, quos dolores.', '2024-09-26 18:19:31', '2024-10-02 14:24:47'),
(30, '2195', '2025-01-18', 'JD46319304', '2025-01-18 02:31:00', 'entregado', 'Saba McCormick', '(717) 791-2353', 'Autem, quod tenere atque servare id, quod propositum est, summum profecto malum est. Corpora ferri deorsum suo pondere ad lineam, hunc naturalem esse omnium corporum motum. Deinde ibidem.', '2024-09-26 18:25:46', '2024-09-29 16:55:56'),
(31, '557', '2024-10-23', 'KZ93449624', '2024-10-23 09:07:12', 'en_transito', 'Alida Heibel', '(712) 453-9831', 'In poetis evolvendis, ut ego et Triarius te hortatore facimus, consumeret.', '2024-09-26 18:29:24', '2024-09-27 07:58:06'),
(32, '506', '2025-03-30', 'EB96674778', '2025-03-30 19:50:23', 'asignado', 'Nona Dailly', '(586) 929-2086', 'Dicant in Graecis legendis operam malle consumere. Postremo aliquos. Ferre denique'' -- non enim illum. Posse iucunde vivi, nisi sapienter, honeste iusteque.', '2024-09-26 18:30:54', '2024-10-01 16:10:38'),
(33, '2502', '2025-05-05', 'EQ36249743', '2025-05-05 23:36:55', 'retornado', 'Talbert Giacopini', '(915) 679-0630', 'Errore et inscientia, sapientiamque esse solam, quae nos a. In alios caeco impetu incurrunt, sed intus etiam in. Opera, studio, labore meo doctiores cives mei, nec.', '2024-09-26 18:36:18', '2024-10-02 16:02:31'),
(34, '2384', '2024-11-25', 'WU47289687', '2024-11-25 04:15:26', 'entregado', 'Mureil Jakubovski', '(561) 897-7395', 'Sit elegans, personae tamen et dignitatis esse negent. Contra quos omnis dicendum breviter existimo. Omnia semper desperantes aut malivoli, invidi, difficiles, lucifugi, maledici, monstruosi.', '2024-09-26 18:42:36', '2024-09-28 05:45:13'),
(35, '976', '2025-10-02', 'UL58724794', '2025-10-02 13:51:59', 'pendiente', 'Bob Sloey', '(806) 281-3663', 'Omnino nulla sit utilitas ex amicitia. Iudicio ab eadem illa atomorum, in quo nihil nec summum nec infimum nec medium nec. Comprobavit. Quod quam magnum sit fictae veterum fabulae declarant, in quibus hoc primum est in. Hoc ipso, quod adest, turbulenta est; si vero molita quippiam. Quam interrogare aut interrogari. Ut placet, inquam. Tum dicere exorsus est. Primum igitur, inquit.', '2024-09-26 18:44:54', '2024-10-06 18:32:54'),
(36, '2654', '2025-06-19', 'KP34662021', '2025-06-19 07:35:45', 'entregado', 'Camilla Woolnough', '(859) 182-2132', 'Romano locatus sum, debeo profecto, quantumcumque possum. Et quidem se texit, ne interiret. -- At magnum periculum. Tibi ita videri necesse est, non satis politus iis artibus, quas. Quas qui tenent, eruditi appellantur -- aut ne deterruisset alios a studiis.', '2024-09-26 18:54:53', '2024-10-03 21:30:07'),
(37, '719', '2024-12-03', 'OY81487740', '2024-12-03 07:01:50', 'en_transito', 'Hogan Flatley', '(251) 902-4557', 'Sciscat et probet, id est incorruptis atque integris testibus, si infantes pueri, mutae etiam. Quae sunt vitae sine metu vivere. Quae est enim aut utilior aut ad naturam.', '2024-09-26 19:02:16', '2024-09-28 11:25:04'),
(38, '766', '2025-02-14', 'SS57129765', '2025-02-14 13:26:51', 'pendiente', 'Dolley Duchenne', '(216) 207-6796', 'Voluptatibus nullo dolore nec impediente nec inpendente, quem. Quod omnium philosophorum sententia tale debet.', '2024-09-26 19:04:46', '2024-09-30 11:38:07'),
(39, '767', '2025-08-24', 'AK71658419', '2025-08-24 01:05:52', 'asignado', 'Ewell Cowgill', '(412) 659-7223', 'Atque natum sit, voluptatem appetere eaque gaudere ut. Sophocles vel optime scripserit Electram, tamen male conversam Atilii mihi legendam putem. Esset bonum, desideraret.'' -- Ita credo. . De re cum sit inter doctissimos summa dissensio, quis alienum putet eius. Nihil impedit, quo minus animus.', '2024-09-26 19:09:05', '2024-10-05 16:57:28'),
(40, '1291', '2025-09-12', 'KZ00844838', '2025-09-12 18:18:00', 'retornado', 'Olav Jordi', '(312) 321-2412', 'Ornatus defuit? Ego vero, quoniam forensibus operis, laboribus. Mediocriterne delectat, cum tractat locos ab Aristotele. Conspectum suum venire vetuit, numquid tibi videtur de voluptatibus suis cogitavisse? Iis servire, qui vel utrisque litteris uti velint vel, si suas. Nam quoniam, cum privamur dolore, ipsa liberatione et vacuitate omnis molestiae gaudemus.', '2024-09-26 19:18:06', '2024-10-06 06:04:21'),
(41, '1356', '2025-08-11', 'XE74776913', '2025-08-11 18:13:42', 'asignado', 'Vic Grevile', '(706) 508-8233', 'Faciant id, quod his libris quaeritur, qui sit. Unde hoc sit tam insolens domesticarum. Cur dubitemus dicere et sapientiam propter voluptates expetendam et dolorem ipsum per se. Sed etiam cogitemus; infinitio ipsa, quam.', '2024-09-26 19:27:36', '2024-10-05 09:11:16'),
(42, '690', '2024-11-09', 'NP11453159', '2024-11-09 18:02:12', 'retornado', 'Cheslie Burtenshaw', '(727) 543-8500', 'Est nihil ad Epicurum. Nam si ea sola voluptas.', '2024-09-26 19:36:18', '2024-09-27 20:30:20'),
(43, '1632', '2025-04-01', 'QS77113809', '2025-04-01 00:10:16', 'pendiente', 'Dotty Farlam', '(239) 471-0572', 'Usque ad senectutem esse discenda. Quae cum dixisset. Solet. Nec vero, ut noster Lucilius, recusabo, quo minus omnes. Peccant, cum e quibus haec efficiantur ignorant. Animi autem.', '2024-09-26 19:38:14', '2024-10-01 18:04:33'),
(44, '699', '2025-06-13', 'II59489198', '2025-06-13 19:39:26', 'en_transito', 'Cullan Jakubowski', '(843) 452-5299', 'Et collaudata est, cum esset accusata et vituperata ab Hortensio. Qui. Esse docui cum voluptate, ut. Atque corrupti, quos dolores et quas molestias excepturi sint. Scribentur fortasse plura, si vita suppetet; et tamen, qui diligenter haec, quae.', '2024-09-26 19:43:40', '2024-10-03 18:42:01'),
(45, '1249', '2025-06-20', 'KC87951727', '2025-06-20 12:33:58', 'entregado', 'Annabell Matiashvili', '(281) 842-2401', 'Numen horreat nec praeteritas voluptates effluere patiatur earumque assidua recordatione laetetur, quid est, quod nullam. Depulsa est, ipsa detractio molestiae. Si tota oratio nostra omnem sibi fidem sensibus. Earum motus et impetus quo pertineant non intellegamus, tu tam egregios viros.', '2024-09-26 19:50:55', '2024-10-03 23:13:46'),
(46, '359', '2025-04-01', 'IX73764051', '2025-04-01 09:38:20', 'asignado', 'Dinny Joicey', '(858) 817-1880', 'Hominem maximi cadere possunt, nulla spe proposita fore levius. Praesidium, in quo a populo Romano locatus sum, debeo profecto, quantumcumque possum. Id omnia referri oporteat, ipsum autem nusquam. Hoc Epicurus in voluptate est. Extremum autem.', '2024-09-26 19:58:20', '2024-10-01 18:40:13'),
(47, '1841', '2025-04-30', 'ZK42988896', '2025-04-30 09:43:16', 'retornado', 'Leanor Kincaid', '(309) 344-4142', 'Se aut pecuniae studuisse aut imperiis aut opibus aut gloriae. Notae sunt. Atque eos, quos nominavi, cum inciderit, ut id meo arbitratu facerem, ante. Autem illud vel maxime, quod ipsa natura incorrupte atque integre iudicante. Itaque negat opus esse.', '2024-09-26 20:03:47', '2024-10-02 13:49:54'),
(48, '1119', '2025-06-30', 'XP10134549', '2025-06-30 21:37:21', 'entregado', 'Babbie Turfus', '(347) 443-7893', 'De re cum sit inter doctissimos summa dissensio, quis alienum putet eius esse dignitatis. Dolor afferat, eorum tamen utrumque et ortum esse e. Specie voluptatis tradunt se libidinibus constringendos nec quid eventurum sit provident ob eamque. Videatur indignius. Ad maiora enim quaedam nos natura genuit et conformavit, ut mihi videtur, expediunt.', '2024-09-26 20:09:56', '2024-10-04 06:22:12'),
(49, '250', '2025-07-04', 'UG50205621', '2025-07-04 20:08:36', 'pendiente', 'Julietta Hebson', '(402) 180-9530', 'Ut Epicuro placet, nihil dolere, primum tibi. Maiores fuissent, et in conspectum. Posse iudicare arbitrarer, plura suscepi veritus. Mollit anim id est quo melius viveremus, eas ergo artes persequeretur, vivendi artem.', '2024-09-26 20:17:36', '2024-10-04 09:05:14'),
(50, '2318', '2024-10-20', 'AR40813307', '2024-10-20 21:53:43', 'en_transito', 'Teddy Marre', '(731) 042-1996', 'Existimo, neque eum Torquatum, qui hoc primus.', '2024-09-26 20:25:22', '2024-09-27 08:16:42'),
